import React from 'react'
import image1 from "../imgs/zap1.png";
import image2 from "../imgs/zap2.jfif";
import image3 from "../imgs/zap3.jfif";
import image4 from "../imgs/Zap4.jfif";



function Productos() {
  return (
    <div>
        <p id ="cont">Poductos</p>
        <img src={image1} className="img-thumbnail"/>
        <img src={image2} className="img-thumbnail"/>
        <img src={image3} className="img-thumbnail"/>
        <img src={image4} className="img-thumbnail"/>
    </div>
  )
}

export default Productos
